import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import "../css/navbar.css"
import IconButton from '@mui/material/IconButton';
import SettingsIcon from '@mui/icons-material/Settings';
import AddCircleIcon from '@mui/icons-material/AddCircle';
export class Navbar extends Component {
  render() {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark ">  
        <img src="https://yenettacode.com/wp-content/uploads/2022/04/YenettaWebBlack-2.png" alt="default pic"  className='logo navbar-brand'/> 
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbar">
        <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id='navbar'>
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">
                <Link to="/view" className='nav-link ms-2'>View Employees</Link>
                </li>
                {/* <li className="nav-item">
                <Link to="/update/:id" className='nav-link'>Edit Employee</Link>
                </li> */}
            </ul>
          <div class="d-flex">
          <Link to="/create" className='btn btn-success me-3'>
          Add Employee
          <AddCircleIcon className='ms-2' />
          </Link>
          {/* <button className="btn btn-primary me-3" type="submit">Add Employee */}
          {/* <AddCircleIcon className='ms-2' /> */}
          {/* </button> */}
          <IconButton>
          <SettingsIcon style={{color: "white"}}/>
        </IconButton>
        </div>
    
        </div>
        </nav>
    )
  }
}

export default Navbar
